import './App.css';

function Sidebar() {
  return (
    <div className="App">
     <button className='Pbtn'>Profile</button>
     <button className='Lbtn'>Labs</button>
     <button className='Tbtn'>Theory</button>
     <button className='Ebtn'>Examn</button>


    </div>
  );
}

export default Sidebar;
